syntax = "proto3";

package proto.common.external_vendor.aws.v1;

import "google/protobuf/timestamp.proto";

message AwsInstanceInformation {
    AwsInstanceType instance_type = 1;
    repeated AwsRegion regions = 2;
    AwsInstanceCpu cpu = 3;
    double memory_size_in_gigabytes = 5;
    AwsInstanceStorage storage = 6;
    AwsInstanceGpu gpu = 7;
    AwsInstanceFpga fpga = 8;
    bool dedicated_support = 9;
    bool auto_recovery_support = 10;
    bool hibernation_support = 11;
    bool current_generation = 12;
    bool burstable_performance_support = 13;
    bool bare_metal = 14;
    AwsHypervisor hypervisor = 15;
    repeated AwsRootDeviceType supported_root_device_types = 16;
    AwsEbsOptimizationSupport ebs_optimization_support = 17;
    AwsEnaSupport ena_support = 18;
    bool ena_express_support = 19;
    AwsEbsNvmeSupport ebs_nvme_support = 20;
    AwsInstanceNetworkInterface network_interface = 21;
    repeated AwsInstancePlacementGroupStrategy supported_placement_group_strategies = 22;
    google.protobuf.Timestamp updated_at = 23;
}

message AwsInstancePlacementGroupStrategy {
    string strategy = 1;
    AwsInstancePlacementGroupStrategyEnum strategy_enum = 2;
}

enum AwsInstancePlacementGroupStrategyEnum {
    AWS_INSTANCE_PLACEMENT_GROUP_STRATEGY_ENUM_UNSPECIFIED = 0;
    AWS_INSTANCE_PLACEMENT_GROUP_STRATEGY_ENUM_CLUSTER = 1;
    AWS_INSTANCE_PLACEMENT_GROUP_STRATEGY_ENUM_PARTITION = 2;
    AWS_INSTANCE_PLACEMENT_GROUP_STRATEGY_ENUM_SPREAD = 3;
}

message AwsInstanceNetworkInterface {
    int32 maximum_network_interfaces = 1;
    int32 ipv4_addresses_per_interface = 2;
    int32 ipv6_addresses_per_interface = 3;
    bool ipv6_support = 4;
}

message AwsEbsNvmeSupport {
    string support = 1;
    AwsEbsNvmeSupportEnum support_enum = 2;
}

enum AwsEbsNvmeSupportEnum {
    AWS_EBS_NVME_SUPPORT_ENUM_UNSPECIFIED = 0;
