    AWS_EBS_NVME_SUPPORT_ENUM_SUPPORTED = 2;
    AWS_EBS_NVME_SUPPORT_ENUM_UNSUPPORTED = 3;
}

message AwsEnaSupport {
    string support = 1;
    AwsEnaSupportEnum support_enum = 2;
}

enum AwsEnaSupportEnum {
    AWS_ENA_SUPPORT_ENUM_UNSPECIFIED = 0;
